import React from 'react';
import { Route, Routes, Navigate} from "react-router-dom";

const ProtectedRoute = ({
  component: Component,
  ...props
}) => {
  return ( 

  <Route > {
      () => props.loggedIn ? <Component {...props} /> : <Navigate to="./register" />// допишите логику здесь
    } </Route>

  )
}

export default ProtectedRoute;
